def count_nucleotide(dna_string):
    dna_dict = {'A': 0, 'C': 0, 'G': 0, 'T': 0}
    for i in dna_string:
        dna_dict[i]+=1
    [print (i, end=' ') for i in dna_dict.values()]

count_nucleotide("")